import React from 'react';
import './Main.scss';
import Manifesto from '../sections/Manifesto';
import Team from '../sections/Team';
import Product from '../sections/Product';
import Contact from '../sections/Contact';

const Main = () => {
  return (
    <main className="main">
      <Manifesto />
      <Team />
      <Product />
      <Contact />
    </main>
  );
};

export default Main;
